// SPDX-License-Identifier: MIT

pragma solidity ^0.8.11;

contract MicroGridContract {


    struct EnergyOffer {
        address asset;
        uint256 price;
        uint startDate;
        uint endDate;
    }



    mapping (address => EnergyOffer) public eWOffersList;

    EnergyOffer[] public listOffers;


    function createEnergyOffer(address asset, uint256 price , uint startDate, uint endDate) external {  

        // eWOffersList[msg.sender] = EnergyOffer(id++,asset,price,startDate,endDate);
        listOffers.push(EnergyOffer(asset,price,startDate,endDate));

    }

    function returnOffers() external view  returns (EnergyOffer[] memory list) {
        list = listOffers;

        return list;
    }  
}
